import React from "react";
import { useGetProductsQuery } from "../store/order/order.api";
import OrderItem from "../components/OrderItem"
export function AllOrders(){
    const {data,error,isLoading}=useGetProductsQuery(4)
    return (       
        <div>
            {/* {isLoading ? ( 
                'Loading..'
            ):error?(
                <div>{error}</div>
            ):(
                <div>
                    {data?.map((order:any)=>
                    (
                        <OrderItem key={order.id} order={order}/> 
                    ))}
                </div>
            )
            } */}

            {isLoading ? (
				'Loading...'
			) : error ? (
				<div className='text-red'>Error</div>
			) : (
				<div className='flex flex-wrap justify-between'>
					{data?.map(order => (
						<OrderItem key={order.id} order={order} />
					))}
				</div>
			)}
        </div>
    )
}
